function Todo({todoText, todoId}) {
    return (

        <div className="todo" key={todoId}>
            <span className="todo-text">
            {todoText}
            </span>
            <span className="todo-tools">
            <span className="todo-edit">-</span>
            <span className="todo-delete">x</span>
            </span>
        </div>
    )
}

export default Todo
